import React from "react";
import './content.css';
function Content() {
    return (
        <div className="content">
            <div>
                <p><FontAwesomeIcon icon={faFaceSmile} />  
                
                <FontAwesomeIcon icon={faCircleDollar} /></p>
            </div>
        </div>
    );
}

export default Content;
